import MemoryCard from '../MemoryCard/MemoryCard';

import classes from './MemoryCards.module.css';

const MemoryCards = () => {
    return (
        <div className={classes.MemoryCards}>
            <h2>MemoryCards</h2>
            <MemoryCard title="A"/>
            <MemoryCard title="A"/>
            <MemoryCard title="B"/>
            <MemoryCard title="B"/>
            <MemoryCard title="C"/>
            <MemoryCard title="C"/>
        </div>
    );
}

export default MemoryCards;
